import React from 'react';
import {RiHome7Line} from 'react-icons/ri';
import {ImInfo,ImProfile,ImHome3} from 'react-icons/im';

export const Navitems = [
    {   
        id: "1",
        title: 'Home',
        path: '/home',
        icon: <ImHome3/>,
    },
    {
        id: "2",
        title: 'Profile',
        path: '/profile',
        icon: <ImProfile/>,
    },
    {
        id: "3",
        title: 'About',
        path: '/about',
        icon: <ImInfo/>,
    },
]
